import useFetch from '../hooks/useFetch'
import './list.css'

function List(){

  const list = useFetch('http://127.0.0.1:3000/service/list')
    return (
    <>
      <div id="service-list">
          <h2>Servicios Disponibles</h2>
          </div>

        <div>
        {list?.map(lis => 
        <span key={lis.id}>
          <div id="list">
            <label>Titulo:</label> <span>{lis.title}</span>
            <label>Descripcion:</label> {lis.description}
            <label>Comentarios:</label> {!lis.comments ? 'No hay datos' : lis.comments}
            <label>Archivos:</label> {!lis.file && 'No hay datos'} 
          </div> 
        </span>)} 
         </div>
    </>
  )
 }

 export default List
